import styled from "styled-components";

const Container = styled.div`
  background-color: black;
  color: white;
  z-index: 1000;
  position: absolute;
  top: 0px;
  width: 100%;
  height: 100px;
`;

function BaseHeader() {
  return <Container>Base Hedaer</Container>;
}

export default BaseHeader;
